import React from 'react';
import './ThisWeek.css';

function ThisWeek() {
    const completedDays = ['Sun', 'Mon', 'Tue', 'Thu'];
    const daysOfWeek = ['Sun', 'Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat'];

    return (
        <div className="days-container">
            {daysOfWeek.map(day => (
                <div key={day} className={`day ${completedDays.includes(day) ? 'completed' : ''}`}>
                    {day}
                    {completedDays.includes(day) && <span className="checkmark">✔️</span>}
                </div>
            ))}
        </div>
    );
}

export default ThisWeek;
